import React from "react";

const TextField = ({ label, inputs, onChange, value,errorMessage}) => {
  return (
    <>
      <div>
        <label className="form-label ">{label}</label>
        <input
          className="form-control"
          style={{ width: "210px" }}
          {...inputs}
          onChange={onChange}
          value={value} 

        />
        <span style={{fontSize:'12px',padding:'3px',color:'red'}}>{errorMessage}</span>
      </div>
    </>
  );
};

export default TextField;
